var OfficeUIRibbon=angular.module("OfficeUIRibbon");OfficeUIRibbon.controller("OfficeUIRibbon",["$scope","$http",function(b,c){var a=this;a.activeContextualGroups=[];a.activeContextualTabs=null;c.get($.fn.OfficeUI.ribbonDataFile).success(function(d){a.Tabs=d.Tabs;a.ContextualGroups=d.ContextualGroups;a.activeTab=d.Tabs[1].Id}).error(function(d){console.error("An error occured while loading the file '"+$.fn.OfficeUI.ribbonDataFile+"' file. ")});b.setActive=function(d){a.activeTab=d};b.isActive=function(d){return a.activeTab==d};b.isContextualGroupActive=function(){return a.activeContextualGroups.length>0};b.activateContextualGroup=function(d){if(!b.isActiveContextualGroup(d)){a.activeContextualGroups.push(d)}};b.deactivateContextualGroup=function(e){var d=$(a.ContextualGroups).filter(function(g,h){return h.Id==e});var f=$(d[0].Tabs).filter(function(g,h){return h.Id==a.activeTab});if(f.length>0){b.setActive(a.Tabs[1].Id)}a.activeContextualGroups=jQuery.grep(a.activeContextualGroups,function(g){return g!=e})};b.isActiveContextualGroup=function(e){var d=$(a.activeContextualGroups).filter(function(f,g){return g==e});return d.length>0}}]);